import styles from "./Navbar.module.css";

const Navbar = (props) => {
    return(
    <div className="nav">
        <h2>Shibu.co</h2>
        <ul>
        <li>Home </li>
        <li>About </li>
        <li>Contact </li>
        </ul>
    </div>
    );
};

export default Navbar;
